import React from 'react';
import ReactDOM from 'react-dom';

module.exports = class Layout extends React.Component {
    static defaultProps = {
        width: 500,
        height: 500,
        styx: 'data:image/png;base64,'
    }

    constructor (props) {
        super(props);
        this.state = {
            imagePresent: false
        };
    }

    createStyx () {
        const styx = new Image();
        styx.src = this.props.styx;
        return styx;
    }

    onFileUpload (e) {
        const {width, height} = this.props;
        const reader = new FileReader();
        const file = ReactDOM.findDOMNode(this.refs.fileInput).files[0];
        const image = new Image();

        reader.onloadend = () => {
            this.setState({imagePresent: true}, () => {
                const canvas = ReactDOM.findDOMNode(this.refs.canvasField).getContext('2d');
                image.src = reader.result;
                canvas.drawImage(image, 0, 0);
                canvas.drawImage(this.createStyx(), 0, 0, width, height);
            });
        };

        reader.readAsDataURL(file);
    }

    render () {
        const {width, height} = this.props;
        const style = {width, height};

        if (this.state.imagePresent) {
            return (
                <canvas className="styxer" ref="canvasField" width={width} height={height}/>
            );
        }

        return (
            <label htmlFor="styxer-file-uploader" className="styxer" style={style}>
                <input
                    id="styxer-file-uploader"
                    accept="image/*"
                    type="file"
                    ref="fileInput"
                    onChange={this.onFileUpload.bind(this)}
                />
            </label>
        );
    }
}
